  getStarted:{
    display:'flex'
  },
  inputDiv:{

    '& *':{
      border:0,
      height: '78px',
      width:'100px',
      border: '1px solid #E3E7E2',
      borderRadius: '100px 0px 0px 100px',
    }
  },
  buttonDiv:{
    '& button':{
      height: '70px',
      fontFamily: 'Roboto',
      fontSize: '18px',
      fontStyle: 'normal',
      fontWeight: '400',
      lineHeight: '24px',
      letterSpacing: '0em',
      textAlign: 'center',
      border: '1px solid #E3E7E2',
      borderRadius: '0 100px 100px 0',
      backgroundColor:"#415AFF",
      color:'white'
    }
  }


})
